INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Reversi', 'Classic games', 'The Classic Othello board game. Players take turns placing disks on the board with their assigned color facing up. During a play, any disks of the opponent''s color that are in a straight line and bounded by the disk just placed and another disk of the current player''s color are turned over to the current player''s color. The object of the game is to have the majority of disks turned to display your color when the last playable empty square is filled. Play this game against a human opponent here: http://www.yourturnmyturn.com.', PARSEDATETIME('2015-09-30', 'yyyy-MM-dd'), 480, 800, 2.92, 13, 'https://cdn.htmlgames.com/Reversi/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=Reversi&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/Reversi/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/Reversi/img/icon/icon-196x196.png');
