INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Double Freecell', 'Solitaire', 'Twice the number of cards, double the Fun! All cards from 2 decks are dealt into 10 tableau piles. There are 6 Free Cells (top left) and 4 Foundation piles (top right). The object of the game is to build up all cards on the foundations by suit from Ace to King, wrapping to Ace and then to King again.<br/>Top cards of tableau piles and cards from the Free Cells are available for play. You can build tableau piles down bij alternate color. Only one card at a time can be moved (but you can move groups of cards in the proper sequence if you have enough Free Cells and/or empty tableau piles). The top card of any tableau pile can also be moved to any Free Cell. Each Free Ceel may contain only 1 card. Cards in the Free Cells may be moved to the foundation piles or back to the tableau piles, if possible.', PARSEDATETIME('2015-01-06', 'yyyy-MM-dd'), 480, 800, 4.0, 0, 'https://cdn.htmlgames.com/DoubleFreecell/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=DoubleFreecell&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/DoubleFreecell/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/DoubleFreecell/img/icon/icon-196x196.png');
