INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Freecell Solitaire', 'Solitaire', 'Classic Freecell Solitaire game. All cards from 1 deck are dealt into 8 tableau piles. There are Four Free Cells (top left) and four foundation piles (top right). The object of the game is to build up all 52 cards on foundations from Ace to King by suit.  Top cards of tableau piles and cards from the Free Cells are available for play. You can build tableau piles down by alternating color. Only one card at a time can be moved (but you can move group of cards in the proper sequence if you have enough free Cells and/or tableau piles). Thet op card of any tableau pile can also be moved to any Free Cell. Each Free Cell may contain only one card. Cards in the cells can be moved to the foundation piles or back to the tableau piles, if possible.', PARSEDATETIME('2014-12-24', 'yyyy-MM-dd'), 480, 800, 2.76, 159, 'https://cdn.htmlgames.com/FreecellSolitaire/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=FreecellSolitaire&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/FreecellSolitaire/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/FreecellSolitaire/img/icon/icon-196x196.png');
