INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Wild West Solitaire', 'Solitaire', 'Klondike type of card game that starts easy and and gets more difficult in next levels. Build the four top foundations in suit up from Ace to King. Cards on the tableau can be played on top of other cards in sequence down, but with alternation color. You can place any card or a sequense of cards on an empty spot. Click on the stack )top left) to get a new open card.', PARSEDATETIME('2014-07-08', 'yyyy-MM-dd'), 480, 800, 3.65, 0, 'https://cdn.htmlgames.com/WildWestSolitaire/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=WildWestSolitaire&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/WildWestSolitaire/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/WildWestSolitaire/img/icon/icon-196x196.png');
