INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Tarantula Solitaire', 'Classic games', 'Variant on the classic Spider Solitaire card game. Create sequences of cards in suit from King to Ace to remove them from the game. You can move a card or a valid sequence (same color: red or black) to an empty spot or to a card 1 higher in value. Click on the stack (top left) to get new cards.', PARSEDATETIME('2015-04-16', 'yyyy-MM-dd'), 480, 800, 4.6, 0, 'https://cdn.htmlgames.com/TarantulaSolitaire/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=TarantulaSolitaire&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/TarantulaSolitaire/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/TarantulaSolitaire/img/icon/icon-196x196.png');
