INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Freecell Giza Solitaire', 'Solitaire', 'Classic Pyramid Solitaire game with freecells: Add up two cards to a total value of 13 to remove the cards. A King (K) is 13 points and can be removed as a single card, a Queen (Q) is 12 points, a Jack (J) is 11 points and an Ace (A) is worth 1 point. Use the freecells (top) wisely. Every new level is more difficult because it has once freecell less.', PARSEDATETIME('2014-03-04', 'yyyy-MM-dd'), 480, 800, 5.0, 0, 'https://cdn.htmlgames.com/FreecellGizaSolitaire/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=FreecellGizaSolitaire&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/FreecellGizaSolitaire/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/FreecellGizaSolitaire/img/icon/icon-196x196.png');
INSERT INTO game (id, name, category, desc, created, height, width, rating, played, url, embed, youtube, thumb, picture) VALUES (NEXTVAL('hibernate_sequence'), 'Taj Mahal Solitaire', 'Solitaire', 'Taj Mahal Solitaire is a combination of Klondike and Indian Patience. Try to get all cards to the top 4 foundations from Ace to King. You can build cards on the tableau down (except on the same color) and you can also move sequences. If on a tableau column there is 1 card left, then the card becomes protected until the stock (top left) is depleted. A protected card cannot be used on the tableau. Click on the stock to get a new open card. On an empty tableau column you can place any card (or sequence).', PARSEDATETIME('2014-03-04', 'yyyy-MM-dd'), 480, 800, 3.58, 0, 'https://cdn.htmlgames.com/TajMahalSolitaire/index.html', '<div><script src="https://cdn.htmlgames.com/embed.js?game=TajMahalSolitaire&amp;width=800&amp;height=480&amp;bgcolor=white"></script></div>', null, 'https://cdn.htmlgames.com/TajMahalSolitaire/img/icon/image-300x200.jpg', 'https://cdn.htmlgames.com/TajMahalSolitaire/img/icon/icon-196x196.png');
